import ph1 from '../../images/photo1.jpg';
import ph2 from '../../images/photo2.jpg';
import ph3 from '../../images/photo3.jpeg';

class Cards extends Component {
	render() {
		return (
            <div className="row">
                <div className="col">
                <div className="card">
                    <img src={ph1} style={{borderRadius: '50%'}} />
                    <div className="body">
                        <h3>This is my title</h3>
                        <p>blah blah blah blah blah blah blah</p>
                    </div>
                </div>
                </div>
                <div className="col">
                <div className="card">
                    <img src={ph2} style={{borderRadius: '50%'}} />
                </div>
                </div>
                <div className="col">
                <div className="card">
                    <img src={ph3} style={{borderRadius: '50%'}} />
                </div>
                </div>
            </div>
		);
	}
}

export default Cards;
